import icon from './icon.png';
import {Link} from "react-router-dom";
import React, { useEffect, useState } from "react";



const Section2 = () => {
    const [message, setMessage] = useState('');

    useEffect(() => {
    const WebSocket = require('ws');

    const socket = new window.WebSocket('ws://localhost:8080');
    socket.onmessage = (event) => {
        setMessage(event.data);

      let parse_data = JSON.parse(event.data)
      let hr = parse_data.heartrate
      let rp = parse_data.resp
      let tp = parse_data.temp

      if (parse_data.user === 'user1'){
        user1_hr=hr;
        user1_rp=rp;
        user1_tp=tp;
      }
      if (parse_data.user === 'user2'){
        user2_hr=hr;
        user2_rp=rp;
        user2_tp=tp;
      }
      if (parse_data.user === 'user3'){
        user3_hr=hr;
        user3_rp=rp;
        user3_tp=tp;
      }
      if (parse_data.user === 'user4'){
        user4_hr=hr;
        user4_rp=rp;
        user4_tp=tp;
      }
      if (parse_data.user === 'user5'){
        user5_hr=hr;
        user5_rp=rp;
        user5_tp=tp;
      }
      if (parse_data.user === 'user6'){
        user6_hr=hr;
        user6_rp=rp;
        user6_tp=tp;
      }
      if (parse_data.user === 'user7'){
        user7_hr=hr;
        user7_rp=rp;
        user7_tp=tp;
      }
      if (parse_data.user === 'user8'){
        user8_hr=hr;
        user8_rp=rp;
        user8_tp=tp;
      }
      if (parse_data.user === 'user9'){
        user9_hr=hr;
        user9_rp=rp;
        user9_tp=tp;
      }

    };
    return () => {
      if(socket.readyState===1){
        socket.close();
      }
    };
    }, []);

    return (
        <div className="section">
                  {/* <p>{message}</p> */}
            <div className="experience">
            {/* <a name="target2"></a> */}
                <div>
                <div className="row1">
                <div className="square">
                <Link to={"/Detail1"}>
                    <div id="data" className="click">#1</div><br/>
                    <div id="pw">ID : <br/>NAME : </div>
                    <div id="view">View details</div>
                </Link>              
                </div>  
                </div>
                <div className="row1">
                <div className="square">
                <Link to={"/Detail2"}>
                <a><div id="data" className="click">#2</div><br/>
                    <div id="pw">ID : <br/>NAME : </div>
                    <div id="view">View details</div></a>
                </Link>              
                </div>                 
                </div>
                <div className="row1">
                <div className="square">
                <Link to={"/Detail3"}>
                <a><div id="data" className="click">#3</div><br/>
                    <div id="pw">ID : <br/>NAME : </div>
                    <div id="view">View details</div></a>
                </Link>              
                </div>                  
                </div>
                </div>
                <div>
                <div className="row2">
                <div className="square">
                <Link to={"/Detail4"}>
                <a><div id="data" className="click">#4</div><br/>
                    <div id="pw">ID : <br/>NAME : </div>
                    <div id="view">View details</div></a>
                </Link>              
                </div>                 
                </div>
                <div className="row2">
                <div className="square">
                <Link to={"/Detail5"}>
                <a><div id="data" className="click">#5</div><br/>
                    <div id="pw">ID : <br/>NAME : </div>
                    <div id="view">View details</div></a>
                </Link>              
                </div>           
                </div>
                <div className="row2">
                <div className="square">
                <Link to={"/Detail6"}>
                <a><div id="data" className="click">#6</div><br/>
                    <div id="pw">ID : <br/>NAME : </div>
                    <div id="view">View details</div></a>
                </Link>              
                </div>               
                </div>
                </div>

                <div>
                <div className="row3">
                <div className="square">
                <Link to={"/Detail7"}>
                <a><div id="data" className="click">#7</div><br/>
                    <div id="pw">ID : <br/>NAME : </div>
                    <div id="view">View details</div></a>
                </Link>              
                </div>                 
